    "styles": "\n        /* Custom styles for dark theme and animations */\n        :root {\n            --primary-bg: #1a1a1a;\n            --secondary-bg: #2a2a2a;\n            --text-primary: #ffffff;\n            --text-secondary: #a0a0a0;\n            --accent-orange: #ff6b35;\n            --accent-hover: #e55a2b;\n        }\n\n        body {\n            background-color: var(--primary-bg);\n            color: var(--text-primary);\n            font-family: 'Slabo 27px', serif;\n            font-weight: 400;\n            line-height: 1.6;\n            -webkit-font-smoothing: antialiased;\n            -moz-osx-font-smoothing: grayscale;\n        }\n        \n        /* Typography improvements for Slabo 27px */\n        h1, h2, h3, h4, h5, h6 {\n            font-weight: 400;\n            letter-spacing: 0.01em;\n        }\n        \n        .font-bold {\n            font-weight: 400;\n        }\n        \n        .font-semibold {\n            font-weight: 400;\n        }\n        \n        .font-medium {\n            font-weight: 400;\n        }\n        \n        /* Button and form typography */\n        button, input, select, textarea {\n            font-family: inherit;\n            font-weight: 400;\n        }\n        \n        .btn-primary {\n            font-weight: 400;\n            letter-spacing: 0.01em;\n        }\n        \n        /* Navigation typography */\n        .nav-link {\n            font-weight: 400;\n            letter-spacing: 0.01em;\n        }\n\n        .gradient-text {\n            background: linear-gradient(45deg, #ff6b35, #f7931e);\n            -webkit-background-clip: text;\n            -webkit-text-fill-color: transparent;\n            background-clip: text;\n        }\n\n        .glass-effect {\n            background: rgba(42, 42, 42, 0.8);\n            backdrop-filter: blur(10px);\n            border: 1px solid rgba(255, 255, 255, 0.1);\n        }\n\n        .upload-area {\n            border: 2px dashed #4a4a4a;\n            transition: all 0.3s ease;\n        }\n\n        .upload-area:hover {\n            border-color: var(--accent-orange);\n            background-color: rgba(255, 107, 53, 0.05);\n        }\n\n        .upload-area.dragover {\n            border-color: var(--accent-orange);\n            background-color: rgba(255, 107, 53, 0.1);\n        }\n\n        .btn-primary {\n            background: linear-gradient(45deg, var(--accent-orange), #f7931e);\n            transition: all 0.3s ease;\n        }\n\n        .btn-primary:hover:not(:disabled) {\n            background: linear-gradient(45deg, var(--accent-hover), #d8810f);\n            transform: translateY(-2px);\n            box-shadow: 0 10px 20px rgba(255, 107, 53, 0.3);\n        }\n\n        .btn-primary:disabled {\n            background: #4a4a4a;\n            cursor: not-allowed;\n            transform: none;\n            box-shadow: none;\n        }\n\n        .card {\n            background: var(--secondary-bg);\n            border: 1px solid rgba(255, 255, 255, 0.1);\n            transition: all 0.3s ease;\n        }\n\n        .card:hover {\n            transform: translateY(-5px);\n            box-shadow: 0 20px 40px rgba(0, 0, 0, 0.3);\n        }\n\n        .testimonial-card {\n            background: var(--secondary-bg);\n            border: 1px solid rgba(255, 255, 255, 0.1);\n            transition: all 0.3s ease;\n        }\n\n        .smooth-scroll {\n            scroll-behavior: smooth;\n        }\n\n        .fade-in {\n            animation: fadeIn 0.6s ease-in-out;\n        }\n\n        @keyframes fadeIn {\n            from { opacity: 0; transform: translateY(20px); }\n            to { opacity: 1; transform: translateY(0); }\n        }\n\n\n        .copy-success {\n            animation: copySuccess 0.5s ease-in-out;\n        }\n\n        @keyframes copySuccess {\n            0% { transform: scale(1); }\n            50% { transform: scale(1.1); color: #4ade80; }\n            100% { transform: scale(1); }\n        }\n\n        /* RTL support for Arabic */\n        [dir=\"rtl\"] {\n            text-align: right;\n        }\n\n        [dir=\"rtl\"] .flex {\n            flex-direction: row-reverse;\n        }\n\n        /* Enhanced spacing and layout */\n        .section-padding {\n            padding: 6rem 2rem;\n        }\n        \n        \n        .container-max-width {\n            max-width: 1200px;\n        }\n        \n        .hero-section {\n            padding: 6rem 2rem 2rem;\n        }\n        \n        .feature-section {\n            padding: 2rem 2rem 2rem;\n        }\n        \n        .inspiration-section {\n            padding: 4rem 2rem;\n        }\n        \n        .tutorials-section {\n            padding: 4rem 2rem;\n        }\n        \n        .evaluation-section {\n            padding: 4rem 2rem;\n        }\n        \n        .faq-section {\n            padding: 4rem 2rem;\n        }\n        \n        .footer-section {\n            padding: 4rem 2rem 2rem;\n        }\n        \n        /* Testimonials Scroll Animation - Three Columns */\n        .testimonials-column {\n            display: flex;\n            flex-direction: column;\n            gap: 1.5rem;\n            animation: scrollUp 40s linear infinite;\n        }\n        \n        .testimonials-column-1 {\n            animation: scrollUp1 35s linear infinite;\n        }\n        \n        .testimonials-column-2 {\n            animation: scrollUp2 45s linear infinite;\n        }\n        \n        .testimonials-column-3 {\n            animation: scrollUp3 40s linear infinite;\n        }\n        \n        .testimonials-column:hover {\n            animation-play-state: paused;\n        }\n        \n        @keyframes scrollUp1 {\n            0% {\n                transform: translateY(0);\n            }\n            100% {\n                transform: translateY(-50%);\n            }\n        }\n        \n        @keyframes scrollUp2 {\n            0% {\n                transform: translateY(0);\n            }\n            100% {\n                transform: translateY(-50%);\n            }\n        }\n        \n        @keyframes scrollUp3 {\n            0% {\n                transform: translateY(0);\n            }\n            100% {\n                transform: translateY(-50%);\n            }\n        }\n        \n        .card-spacing {\n            margin-bottom: 2rem;\n        }\n        \n        .grid-gap-large {\n            gap: 3rem;\n        }\n        \n        .text-spacing {\n            line-height: 1.7;\n            margin-bottom: 1.5rem;\n        }\n        \n        .button-spacing {\n            margin: 2rem 0;\n        }\n        \n        /* Responsive adjustments */\n        @media (max-width: 768px) {\n            .hero-title {\n                font-size: 2.5rem;\n                line-height: 1.2;\n                font-weight: 400;\n                letter-spacing: 0.01em;\n            }\n            \n            .section-padding {\n                padding: 4rem 1rem;\n            }\n            \n            .hero-section {\n                padding: 4rem 1rem 1.5rem;\n            }\n            \n            .feature-section {\n                padding: 1.5rem 1rem 1.5rem;\n            }\n            \n            .inspiration-section,\n            .tutorials-section,\n            .evaluation-section,\n            .faq-section {\n                padding: 3rem 1rem;\n            }\n            \n            .grid-gap-large {\n                gap: 2rem;\n            }\n            \n            /* Mobile testimonials scroll */\n            .testimonials-scroll-container {\n                height: 28rem; /* 448px */\n            }\n            \n            .testimonials-column-1 {\n                animation-duration: 25s; /* Faster on mobile */\n            }\n            \n            .testimonials-column-2 {\n                animation-duration: 35s; /* Faster on mobile */\n            }\n            \n            .testimonials-column-3 {\n                animation-duration: 30s; /* Faster on mobile */\n            }\n        }\n    ",
